  `goods_id` varchar(255) DEFAULT NULL COMMENT '商品ID',
  `goods_name` varchar(255) DEFAULT NULL COMMENT '商品名称',
  `goods_num` int(10) DEFAULT NULL COMMENT '商品件数',
  `goods_sku` varchar(255) DEFAULT NULL COMMENT '商品SKU',
  `goods_pic` varchar(255) DEFAULT NULL COMMENT '商品图片',
  `seller_id` mediumint(8) DEFAULT NULL COMMENT '商家ID',
  `superior_id` int(10) DEFAULT '0' COMMENT '上级联盟ID',
  `user_id` int(10) DEFAULT NULL COMMENT '业务员id',
  `user_name` varchar(50) DEFAULT NULL COMMENT '业务员名称',
  `money` decimal(10,2) unsigned DEFAULT NULL COMMENT '预付金额',
  `down_price` decimal(10,2) unsigned DEFAULT NULL COMMENT '实际下单金额',
