DROP TABLE IF EXISTS `sd_plan`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `sd_plan` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `seller_id` int(10) DEFAULT NULL COMMENT '商家ID',
  `superior_id` int(10) DEFAULT '0' COMMENT '负责人ID',
  `superior_name` varchar(50) DEFAULT NULL COMMENT '负责人名称',
  `shop_id` int(10) DEFAULT NULL COMMENT '店铺ID',
  `shop_name` varchar(100) DEFAULT NULL COMMENT '店铺名称',
  `tpl_id` mediumint(8) NOT NULL COMMENT '模板ID',
  `keyword` varchar(255) DEFAULT NULL COMMENT '商品关键字',
  `count` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '任务数',
  `goods_pic` varchar(255) DEFAULT NULL COMMENT '商品主图',
  `goods_id` varchar(255) DEFAULT NULL COMMENT '商品ID',
  `goods_name` varchar(255) DEFAULT NULL COMMENT '商品名称',
  `goods_price` decimal(10,2) DEFAULT NULL COMMENT '商品下单价',
  `goods_sku` varchar(50) DEFAULT NULL COMMENT '商品SKU',
  `total_price` decimal(10,2) DEFAULT NULL COMMENT '计划金额',
  `down_price` decimal(10,2) DEFAULT NULL COMMENT '实际下单金额',
  `coupon_price` decimal(10,2) DEFAULT NULL COMMENT '优惠券金额',
  `goods_num` int(10) DEFAULT NULL COMMENT '计划宝贝件数',
  `sort_type` tinyint(4) DEFAULT NULL COMMENT '排序方式',
  `sort_min` int(10) DEFAULT NULL COMMENT '排名区间 最小值',
  `sort_max` int(10) DEFAULT NULL COMMENT '排名区间 最大值',
  `view_time` tinyint(4) DEFAULT NULL COMMENT '浏览时间',
  `address` varchar(255) DEFAULT NULL COMMENT '地区',
  `price_min` int(10) DEFAULT NULL COMMENT '价格区间 起始值',
  `price_max` int(10) DEFAULT NULL COMMENT '价格区间 结束值',
  `unit_money` decimal(10,2) DEFAULT NULL COMMENT '佣金单价',
  `seller_money` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '商家本次任务所需扣除的佣金=任务总数*佣金单价',
  `shop_cat_id` int(10) DEFAULT NULL COMMENT '店铺分类ID',
  `shop_cat_name` varchar(50) DEFAULT NULL COMMENT '店铺分类名称',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '状态 0待审核 1已审核 2执行中 3已完成 4审核不通过 5已撤销',
  `create_time` int(10) DEFAULT NULL COMMENT '创建时间',
  `update_time` int(10) DEFAULT NULL COMMENT '更新时间',
  `cancel_time` int(10) DEFAULT NULL COMMENT '取消时间',
  `verify_time` int(10) DEFAULT NULL COMMENT '审核时间',
  `remarks` text COMMENT '备注',
  `begin_time` int(10) DEFAULT NULL COMMENT '要求完成时间',
  `other_remark` varchar(255) DEFAULT NULL COMMENT '模板其他要求',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`),
  KEY `seller_id` (`seller_id`),
  KEY `superior_id` (`superior_id`),
  KEY `goods_id` (`goods_id`),
  KEY `status` (`status`),
  KEY `goods_price` (`goods_price`)
) ENGINE=InnoDB AUTO_INCREMENT=89 DEFAULT CHARSET=utf8 COMMENT='计划表';
/*!40101 SET character_set_client = @saved_cs_client */;

